} impl<T> NonEmptyVec<T> { pub fn new(item: T) -> Self { NonEmptyVec { head: item, tail: Vec::new(), } } pub fn push(&mut self, item: T) { self.tail.push(item); } pub fn get(&self, index: usize) -> Option<&T> { if index == 0 { Some(&self.head) } else { self.tail.get(index - 1) } } pub fn first(&self) -> &T { &self.head } pub fn first_mut(&mut self) -> &mut T { &mut self.head } pub fn last(&self) -> &T { self.tail.last().unwrap_or(&self.head) } pub fn last_mut(&mut self) -> &mut T { self.tail.last_mut().unwrap_or(&mut self.head) } pub fn pop(mut self) -> (T, Vec<T>) { match self.tail.pop() { Some(item) => (item, self.into()), None => (self.head, Vec::new()), } }
} impl<T> From<NonEmptyVec<T>> for Vec<T> { fn from(x: NonEmptyVec<T>) -> Vec<T> { let mut vec = vec![x.head]; vec.extend(x.tail); vec }
}
