} pub fn find_difference<'a, 'b>(sentence1: &'a str, sentence2: &'b str) -> Difference<'a, 'b> { // lifetime annotations here are not required, added for clarity let sentence_1_words: HashSet<&'a str> = words(sentence1); let sentence_2_words: HashSet<&'b str> = words(sentence2); let mut diff = Difference::default(); for word in &sentence_1_words { if !sentence_2_words.contains(word) { diff.first_only.push(word) } } for word in &sentence_2_words { if !sentence_1_words.contains(word) { diff.second_only.push(word) } } // sorting simplifies the equality assertions below diff.first_only.sort(); diff.second_only.sort(); diff
